    const year = props.date.getFullYear();
    console.log(props);
    if (!props ==='Invalid Date') {
    return(
        <div className="expense-date">
            <div className="expense-date__month">
                {month}
            </div>
            <div className="expense-date__year">
                {year}
            </div>
            <div className="expense-date__day">
                {day}
            </div>
        </div>
    )
    }
    else {
        return <></>
    }
}

